const Table = () => {
	return (
		<table>
			<thead style={{ border: "none", background: 'cyan', padding: '10px', borderRadius: '5px'}}>
				<tr>
					<th>Id</th>
					<th>Name</th>
					<th>Username</th>
				</tr>
			</thead>
		</table>
	);
};

export default Table;
